import React from "react";
import "../components/Header.css";
import $ from "jquery";

function Header() {
  document.addEventListener("DOMContentLoaded", function () {
    document.querySelector(".mobile-nav-toggle").addEventListener("click", function () {
        const navbar = document.getElementById("navbar");
        const toggleButton = this;

        if (navbar.classList.contains("navbar-mobile")) {
            navbar.classList.remove("navbar-mobile");
        } else {
            navbar.classList.add("navbar-mobile");
        }

        if (toggleButton.classList.contains("bi-list")) {
            toggleButton.classList.remove("bi-list");
            toggleButton.classList.add("bi-x");
        } else {
        toggleButton.classList.remove("bi-x");
        toggleButton.classList.add("bi-list");
        }
    });
  });

  return (
    <>
      <header id="header">
        <div class="container d-flex align-items-center justify-content-between">
          <div class="logo d-flex align-items-center">
            <div class="logo_img">
              <img
                src={`${process.env.PUBLIC_URL}/assets/images/logo_3.png`}
                alt=""
              />
            </div>
            <h1>
              <a href="#">MILAYNA CAB</a>
            </h1>
          </div>

          <nav id="navbar" class="navbar">
            <ul>
              <li>
                <a class="nav-link" href="{% url 'tripSheetPage' %}">
                  <i class="fas fa-plus"></i> New Trip
                </a>
                <span class="hover"></span>
              </li>
              <li>
                <a class="nav-link" href="{% url 'allTrips' %}">
                  <i class="fas fa-road"></i> View Trips
                </a>
                <span class="hover"></span>
              </li>
              <li>
                <a class="nav-link" href="{% url 'feedbacks' %}">
                  <i class="fa-solid fa-comment-dots"></i> Feedbacks
                </a>
                <span class="hover"></span>
              </li>
              <li>
                <a class="nav-link" href="{% url 'userLogout' %}">
                  <i class="fas fa-sign-out-alt"></i> Logout
                </a>
                <span class="hover"></span>
              </li>
            </ul>
            <i class="bi bi-list mobile-nav-toggle"></i>
          </nav>
        </div>
      </header>
    </>
  );
}

export default Header;
